import Imagem from './Imagem';
const imagens = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://carolateofim.files.wordpress.com/2015/07/img_4654.jpg',
    'https://i.pinimg.com/736x/99/c4/ca/99c4ca2a0faeeebe2caaf0f0e2de2c02.jpg',
    'data:image/jpeg;base64,',
    'https://i.pinimg.com/originals/85/8b/b0/858bb03058f38f902f49ad3238c98764.jpg',
];

function Galeria() {
    return (
        <div className="galeria">
          {imagens.map((url, index) => (
          <Imagem key={index} url={url} />
          ))}
        </div>
    )
}

export default Galeria;